            padding: 24px;
            box-shadow: 0px 3px 5px #091E4266;

            background-color: #fff;
            text-align: center;
        }

        .title_email_verified {
            margin: 0;
            color: #fd5437;
            font-size: 20px;
            font-family: 'Roboto';

        }

        .text_email_verified {sss
            color: #1C1B1B;
            font-size: 16px;
            font-family: 'Roboto';
        }
		 .text_try_again {

            font-size: 16px;
